!function(){"use strict";$.getJSON(window.apiUrl+"/food/liked/"+window.username+"/",function(i){var n=$(".template").children().first().clone();$.each(i,function(i,e){var o=n.clone();o.find(".name").text(e.name),o.find(".price").text(e.price),o.find(".num_likes .num").text(e.num_likes),o.find(".food-photo img").attr("src","images/"+e.photo),o.find(".food-photo, .info").wrap('<a href="food.html?id='+e.id+'"></a>'),$(".main-div").append(o)})})}();